//              COMPONENT FOR PROFILE CARD                  //

// Importing Require Module :
import React from 'react';

// Importing Images From Device :
import junaid from './junaid.jpg'

// Profile Card Component :
function Pro() {

    // Returining the JSX :

    return (
        <>
        <div id="profileSection"></div>
            <div id="ProfileCard">
                <div id="ProfileImg">
                    <img src={junaid}  alt="ERROR"></img>
                </div>
                <div id="ProfileContent">
                    <strong>NAME : </strong> <span>Junaid</span> <br/>
                    <strong>PROFESSION : </strong> <span>Software Developer</span>
                    <button href="#">Profile</button>

                </div>
            </div>
        </>
    )

};


export default Pro;
